import React, { Component } from "react";
import Slider from "react-slick";
import Head from "next/head";

class SlideShow extends Component {
  render() {
    const settings = {
      className:".teen",
      centerMode: true,
      infinite: true,
      centerPadding: "80px",
      slidesToShow: 3,
      speed: 500,
      autoplay: true,
      autoplaySpeed: 3000,
      slickNext:true
      
    };
    return (
      <div>      
        <div className="container col-lg-10 col-md-10 col-sm-10">
          <Head>
              <link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" /> 
              <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" />
              <link rel="stylesheet" type="text/css" href="/static/css/slick1.css" />
          </Head>

          <Slider {...settings}>
                <img src="/static/images/test/test1.png" className="img-fluid" />
                <img src="/static/images/test/test2.png" className="img-fluid" />   
                <img src="/static/images/test/test2.png" className="img-fluid" />  
                <img src="/static/images/test/test4.png" className="img-fluid" /> 
                <img src="/static/images/test/test1.png" className="img-fluid" />
                <img src="/static/images/test/test2.png" className="img-fluid" />         
          </Slider>
          <div>
            <br/>
            <br/>
          </div>
        </div>
      </div>
    );
  }
}

export default SlideShow;
